{
    "url": "/containers/fetch-all",
    "method": "GET",
    "qs": {
        "agentId": "{{parameters.phantom}}",
        "limit": 500
    },
    "response": {
        "iterate": "{{body.containers}}",
        "output": {
            "value": "{{item.id}}",
            "label": "{{'Container created at ' + formatDate(parseDate(item.createdAt, 'x'), 'DD MMM YYYY HH:mm:ss')}}"
        }
    }
}

