function fetchFields(body, phantom) {
	if (!body || !phantom) return;

	const item = body.find((i) => i.id === phantom);
	let arr = [];

	const getFieldType = (property) => {
		switch (property.type) {
			case 'string': {
				if (property.enum) {
					return {
						type: 'select',
						options: property.enum.map((value) => ({ label: value, value })),
					};
				}

				return { type: 'text' };
			}

			case 'boolean':
				return { type: 'boolean' };

			case 'number':
				return { type: 'number' };

			case 'array':
				return { type: 'array' };

			default:
				return { type: 'text' };
		}
	};

	if (item && item.manifest && (item.manifest.argumentForm || item.manifest.argumentSchema)) {
		const steps = item.manifest.argumentForm.steps;
		const properties = item.manifest.argumentSchema.properties;

		steps.length &&
			steps.forEach((step) => {
				const fields = step.fields;
				if (Object.keys(fields).length > 0) {
					for (let [key, value] of Object.entries(fields)) {
						let obj = {};
						//get name
						obj.name = key;
						//get label
						const labelSource = fields[key].label || fields[key].rightLabel || key;
						let regex = fields[key].label ? /( <(.*?)>(.*)|(<(.*?)>))/gm : /<(.*?)>/gm;
						obj.label = labelSource.replace(regex, '');
						//get hint
						if (fields[key].helper) {
							obj.help = fields[key].helper.replace(/<(.*?)>/gm, '');
						}

						for (let [k, v] of Object.entries(properties)) {
							if (key === k) {
								//get type&options
								Object.assign(obj, getFieldType(properties[k]));
								//get default value
								if (properties[k].type && properties[k].default !== undefined)
									obj.default = properties[k].default;
								//get is required value
								if (properties[k].required) obj.required = true;
							}
						}
						arr.push(obj);
					}
				}
			});

		if (!steps.length) {
			for (let k in properties) {
				if (properties[k].type) {
					let obj = {
						name: k,
						label: iml.ifempty(
							properties[k].title,
							iml
								.capitalize(k)
								.match(/[A-Z][a-z]+/g)
								.join(' ')
								.replace('Id', 'ID'),
						),
					};
					Object.assign(obj, getFieldType(properties[k]));
					arr.push(obj);
				}
			}
		}

		return !arr.length
			? undefined
			: {
					name: 'fields',
					label: 'Fields',
					type: 'collection',
					spec: arr,
			  };
	}
}

